import Axios from "axios"


const instance = Axios.create({
    withCredentials: true,
    baseURL: `https://social-network.samuraijs.com/api/1.0/`,
    headers: {
        "API-KEY": "226f16df-9137-4f6e-9e84-3e016b8869e6",
    },
})

export const getUsers = () => {
    instance.get(`users`)}
